function frmCancelEdit(h,l,n,v,p,x){var y=jQuery(document.getElementById("frm_edit_"+h)),w=y.find("a"),z=w.html();w.hasClass("frm_ajax_edited")||(w=jQuery(document.getElementById(l+h)),w.children(".frm_forms").replaceWith(""),w.children(".frm_orig_content").fadeIn("slow").removeClass("frm_orig_content"));y.replaceWith('<a id="frm_edit_'+h+'" class="frm_edit_link '+x+'" href="javascript:frmEditEntry('+h+",'"+l+"',"+v+","+p+",'"+frmFrontForm.escapeHtml(z)+"','"+x+"')\">"+n+"</a>")}
function frmUpdateField(h,l,n,v,p){jQuery(document.getElementById("frm_update_field_"+h+"_"+l)).html('<span class="frm-loading-img"></span>');jQuery.ajax({type:"POST",url:frm_js.ajax_url,data:{action:"frm_entries_update_field_ajax",entry_id:h,field_id:l,value:n},success:function(){""===v.replace(/^\s+|\s+$/g,"")?jQuery(document.getElementById("frm_update_field_"+h+"_"+l+"_"+p)).fadeOut("slow"):jQuery(document.getElementById("frm_update_field_"+h+"_"+l+"_"+p)).replaceWith(v)}})}
function frmDeleteEntry(h,l){jQuery(document.getElementById("frm_delete_"+h)).replaceWith('<span class="frm-loading-img" id="frm_delete_'+h+'"></span>');jQuery.ajax({type:"POST",url:frm_js.ajax_url,data:{action:"frm_entries_destroy",entry:h,nonce:frm_js.nonce},success:function(n){"success"==n.replace(/^\s+|\s+$/g,"")?jQuery(document.getElementById(l+h)).fadeOut("slow"):jQuery(document.getElementById("frm_delete_"+h)).replaceWith(n)}})}
function frmOnSubmit(h){console.warn("DEPRECATED: function frmOnSubmit in v2.0 use frmFrontForm.submitForm");frmFrontForm.submitForm(h,this)}
function frm_resend_email(h,l){console.warn("DEPRECATED: function frm_resend_email in v2.0");$link=jQuery(document.getElementById("frm_resend_email"));$link.append('<span class="spinner" style="display:inline"></span>');jQuery.ajax({type:"POST",url:frm_js.ajax_url,data:{action:"frm_entries_send_email",entry_id:h,form_id:l},success:function(h){$link.replaceWith(h)}})};